import React from "react";
import {Link} from "react-router-dom";
import "./css/Navigation.css"

const Nav = ({loggedUser}) => {

    
  return (
      <nav className="navbar">
          
              { loggedUser && <div className="links">
              <Link to="/" style={{marginLeft: "0px"}}><a>Strona główna</a></Link>
              <Link to="/bpl"><a>Premier League</a></Link>
              <Link to="laliga"><a>La Liga</a></Link>
              <Link to="bundesliga"><a>Bundesliga</a></Link>
              <Link to="ligue1"><a>Ligue 1</a></Link>
              <Link to="allteams" ><a>All teams</a></Link>
              <Link to="twitter" ><a>Twitter news</a></Link>
               {loggedUser && loggedUser.roles[0] === "ROLE_USER" &&  <a><Link to="adminpanel">Admin panel</Link></a>}
              </div>
            }
              {!loggedUser && <div className="links">
              <a><Link to="login"> Log in to see navigation bar</Link></a>
                  </div>}
          
      </nav>
  )

}

export default Nav;
